import{_ as a,o as t,c as n,z as e,a as r}from"./chunks/framework.9482e208.js";const b=JSON.parse('{"title":"§ 62.1-164 Erection and abatement of private wharves, piers and landings.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/62.1-164.md","filePath":"vacode/62.1-164.md"}'),o={name:"vacode/62.1-164.md"},i=e("h1",{id:"§-62-1-164-erection-and-abatement-of-private-wharves-piers-and-landings",tabindex:"-1"},[r("§ 62.1-164 Erection and abatement of private wharves, piers and landings. "),e("a",{class:"header-anchor",href:"#§-62-1-164-erection-and-abatement-of-private-wharves-piers-and-landings","aria-label":'Permalink to "§ 62.1-164 Erection and abatement of private wharves, piers and landings."'},"​")],-1),s=e("p",null,"Any person owning land upon a watercourse may erect a private wharf on the same, or private pier or landing, in such watercourse opposite his land; provided, such wharf, pier or land is for noncommercial purposes and navigation be not obstructed, nor the private rights of any person be otherwise injured thereby. The circuit court of the county in which such wharf, pier or landing is, after causing ten days' notice to be given to the owner thereof, of its intention to consider the subject, if it be satisfied that such wharf, pier or landing obstructs the navigation of the watercourse, or so encroaches on any private landing as to prevent the free use thereof, may abate the same.",-1),c=e("p",null,"Code 1950, § 62-139; 1968, c. 659; 1972, c. 415.",-1),d=[i,s,c];function h(p,l,f,u,v,m){return t(),n("div",null,d)}const g=a(o,[["render",h]]);export{b as __pageData,g as default};
